    this.state = {}
  }
  render(){
    return (
      <Layout>
        <style jsx>{`
          *{
            font-family: 'Arial';
          }
        `}</style>
        <h1 style={{'margin': 'auto'}}>PDanielY</h1>
        <p>Use the sidebar to navigate the page</p>
      </Layout>
    )
  }
}

export default HomePage
